import React from 'react'
import { View,Text } from 'react-native'

function ForgotPassword() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Forgot Password Screen</Text>
    </View>
  )
}

export default ForgotPassword
